import axios from "axios";

export const getMovieList = () => axios.get('http://kobis.or.kr/kobisopenapi/webservice/rest/boxoffice/searchDailyBoxOfficeList.json?key=5622df58bf74fc555a60bcb2baf58da6&targetDt=20210322')
    .then((res) => {
        return res.data
    })

export const getNaverMovie = (movieName) => axios.get(`https://api.themoviedb.org/3/search/movie?api_key=2b2e61361a6d20a07e728e56fc296333&query=${movieName}&language=ko&page=1®ion=KR`)
    .then((res) => {
        return res.data
    })
